(281, 184, 'Group Forums', 207, '1', '1', 1, 0, 8, '', 'guild_forum', '', 'Group Forums are here!|<<i><b><font color=\"#0e3f52\" size=\"16\">What are Group Forums?</font></b></i>\r\n\r\nForums allow you to effortlessly post, comment and discuss topics freely, without even leaving the Hotel!\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Who can start a forum? </font></b></i>\r\n\r\nOnly a group owner can start a forum for their group.\r\n\r\n<i><b><font color=\"#0e3f52\" size=\"16\">Do I need a Forum Terminal?</font></b></i>\r\n\r\nYes - In order to start a Group Forum the group owner must first purchase a forum terminal for the group.\r\n\r\n\r\nFind out more about Group Forums <a href=\"event:habbopages/forums\">here</a>.\r\n\r\nPlease note, we will continue to add more functionalities to this feature in the near future.'),
